Object.Field:
if the member or constructor is declared protected, then access is permitted only when one of the following is true:
- Access to the member or constructor occurs from within the package containing the class in which the protected member or constructor is declared.
- Access to the member or constructor occurs from outside the package in which it is declared only by code that is responsible for the implementation of that object.

